import "./App.css";
import DiaryEditor from "./DiaryEditor";
import DiaryList from "./DiaryList";

const dummyList = [
  {
    id: 1,
    author: "hyejin",
    content: "Hi",
    emotion: 1,
    created_date: new Date().getDate(),
  },
  {
    id: 2,
    author: "hyejin2",
    content: "Hi 2",
    emotion: 3,
    created_date: new Date().getTime(),
  },
  {
    id: 3,
    author: "hyejin3",
    content: "Hi 3",
    emotion: 2,
    created_date: new Date().getTime(),
  },
  {
    id: 4,
    author: "hyejin4",
    content: "Hi 4",
    emotion: 5,
    created_date: new Date().getTime(),
  },
  {
    id: 5,
    author: "hyejin5",
    content: "Hi 5",
    emotion: 4,
    created_date: new Date().getTime(),
  },
];

function App() {
  return (
    <div>
      <DiaryEditor />
      <DiaryList diaryList={dummyList} />
    </div>
  );
}

export default App;
